import React from 'react';
import './App.css';

interface Props {
    todos: Todo[];
    changeTodos: ChangeTodos;
}

export const Todos: React.FC<Props> = ({ todos, changeTodos }) => {
  return (
    <>
        {todos.map(todo => (
        <li>
            <label style={{ textDecoration: todo.complete ? 'line-through' : undefined }}>
                <input defaultChecked type="checkbox" checked={todo.complete} onClick={() => {changeTodos(todo);}}/> {todo.text}
            </label>
        </li>
        ))}
    </>
  );
};
